import React, { useState, useEffect } from "react";
import { ThemeProvider } from "./contexts/ThemeContext";
import { LanguageProvider } from "./contexts/LanguageContext";
import { useTheme } from "./contexts/ThemeContext";
import Header from "./components/Header";
import Home from "./components/Home";
import Skills from "./components/Skills";
import Projects from "./components/Projects";
import Contact from "./components/Contact";
import LoadingScreen from "./components/LoadingScreen";
import Services from "./components/Services";
import PageTransition from "./components/PageTransition";
import CustomCursor from "./components/CustomCursor";
import { motion, useScroll, useSpring } from "framer-motion";

// Scroll progress indicator component
const ScrollProgress = () => {
  const { scrollYProgress } = useScroll();
  const scaleX = useSpring(scrollYProgress, {
    stiffness: 100,
    damping: 30,
    restDelta: 0.001
  });
  const { theme } = useTheme();

  return (
    <motion.div
      className="fixed top-0 left-0 right-0 h-1 z-50 origin-left"
      style={{ 
        scaleX,
        background: theme === "light" 
          ? "linear-gradient(to right, #f97316, #f59e0b)" 
          : "linear-gradient(to right, #3b82f6, #38bdf8)"
      }}
    />
  );
};

// Animated background
const AnimatedBackground = ({ theme }) => {
  return (
    <div className="fixed inset-0 overflow-hidden pointer-events-none">
      <motion.div 
        className={`absolute w-[600px] h-[600px] rounded-full blur-3xl opacity-20
          ${theme === "light" ? "bg-orange-400" : "bg-blue-500"}
          -top-64 -right-64`}
        animate={{ 
          y: [0, 30, 0],
          scale: [1, 1.05, 1],
        }}
        transition={{ 
          duration: 8, 
          repeat: Infinity,
          repeatType: "reverse",
          ease: "easeInOut"
        }}
      />
      <motion.div 
        className={`absolute w-[600px] h-[600px] rounded-full blur-3xl opacity-20
          ${theme === "light" ? "bg-yellow-400" : "bg-purple-500"}
          -bottom-64 -left-64`}
        animate={{ 
          y: [0, -30, 0],
          scale: [1, 1.05, 1],
        }}
        transition={{ 
          duration: 10, 
          repeat: Infinity,
          repeatType: "reverse",
          ease: "easeInOut",
          delay: 1
        }}
      />
      <motion.div 
        className={`absolute w-[400px] h-[400px] rounded-full blur-3xl opacity-10
          ${theme === "light" ? "bg-blue-300" : "bg-purple-300"}
          top-1/4 left-1/3`}
        animate={{ 
          y: [0, 20, 0],
          x: [0, 15, 0],
          scale: [1, 1.03, 1],
        }}
        transition={{ 
          duration: 12, 
          repeat: Infinity,
          repeatType: "reverse",
          ease: "easeInOut",
          delay: 2
        }}
      />
    </div>
  );
};

// Wrapper component to apply theme
const AppContent = () => {
  const { theme } = useTheme();
  const [isLoading, setIsLoading] = useState(true);
  const [pageMounted, setPageMounted] = useState(false);

  useEffect(() => {
    setPageMounted(true);
  }, []);

  return (
    <div className="font-sans relative">
      <CustomCursor />
      {isLoading ? (
        <LoadingScreen onComplete={() => setIsLoading(false)} />
      ) : (
        <PageTransition>
          <div className={`min-h-screen relative overflow-hidden transition-colors duration-500
            ${theme === "light"
              ? "bg-gradient-to-br from-light-background via-white to-orange-50 text-gray-900"
              : "bg-gradient-to-br from-dark-background via-gray-900 to-blue-900 text-white"
            }`}
            style={{ scrollPaddingTop: '80px', cursor: 'none' }}
          >
            <ScrollProgress />
            <AnimatedBackground theme={theme} />
            <Header />
            <div className="scroll-container relative z-10">
              <div className="scroll-section">
                <Home />
              </div>
              <div className="scroll-section">
                <Skills />
              </div>
              <div className="scroll-section">
                <Services />
              </div>
              <div className="scroll-section">
                <Projects />
              </div>
              <div className="scroll-section">
                <Contact />
              </div>
            </div>
          </div>
        </PageTransition>
      )}
    </div>
  );
};

const App = () => {
  return (
    <ThemeProvider>
      <LanguageProvider>
        <AppContent />
      </LanguageProvider>
    </ThemeProvider>
  );
};

export default App;
